try:
        with open(csv_file, 'r') as file:
            reader = csv.reader(file, delimiter=",")
            for row in reader:
                words = list()
                for sentence in row:
                    normalized_sentence = unicodedata.normalize('NFKD', sentence.encode('ascii','ignore'))
                    words.extend(normalized_sentence.split(' '))
            return matplotlib.pyplot.bar([i for i in range(0, len(words))],
                                         [words.count(word) for word in words],
                                         align='center',
                                         width=0.25, color='skyblue'),
                                         list(Counter(words).most_common(10))

    except FileNotFoundError:
        return FileNotFoundError

try:
        with open(csv_file, 'r') as file:
            data = csv.reader(file, delimiter=',')
            words = [unicodedata.normalize('NFKD', row[0]).encode('ascii', 'ignore').decode().strip() for row in data]
        return plt.bar([i+1 for i in range(len(words))], Counter(words).values(),
                       width=0.4, align='edge', edgecolor='black', linewidth=0.8, color='gray'), sorted(Counter(words).items(),
                       key=lambda x: x[1], reverse=True)[:10]
    except FileNotFoundError as fnfe:
        print(fnfe)
    except IOError as ioe:
        print(ioe)
